import React from 'react';
import ReactDOM from 'react-dom';
import { createRoot } from 'react-dom';

import App from './App';

const rootElement = document.getElementById('root');
createRoot(rootElement).render(<App />);


ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
  );
